import React from 'react'
import './Navbar.css'
import logout from '../../assets/logout.png'
import { Link } from 'react-router-dom';

const Navbar = () => {

    function reloadPage() {
        window.location.reload();
    }

  return (
    <div className='nav'>
        <div className="nav-logo" onClick={reloadPage}>G | K </div>
        <div className='list'>Document Management</div>
        <div className='login'>
            <div><p ><Link style={{ color:'black', textDecoration:'none'}} to='/login'>Login</Link></p></div>
            <div><img src={logout} alt="" /></div>
        </div>

    </div>
  )
}

export default Navbar
